          if ("number" != typeof x)
              return throwError.call(this, "x must be a number", cb);
      if (y !== undefined)
          if ("number" != typeof y)
              return throwError.call(this, "y must be a number", cb);
      if (w !== undefined)
          if ("number" != typeof w)
              return throwError.call(this, "w must be a number", cb);
